import React from 'react';
import ReactDOM from 'react-dom';

const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  console.log('props', props.parts[0].name);
  const parts = props.parts;
  return (
    <div>
      <p>{props.parts[0].name}</p>
      {/* <Part name={parts[0].name} exercises={parts[0].exercises}></Part>
      <Part name={parts[1].name} exercises={parts[1].exercises}></Part>
      <Part name={parts[2].name} exercises={parts[2].exercises}></Part> */}
    </div>
  )
}

const Part = (props) => {
  return (
    <p>
      {props.name} {props.exercises}
    </p>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.total}</p>
  )
}

const App = () => {
  const course = "Half Stack application development"
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  console.log("parts", parts);
  return (
    <div>
      <Header course={course}></Header>
      <Content parts={[parts]}></Content>
      <Total total={parts}></Total>
    </div>
  )
}

ReactDOM.render(
    <App />,
  document.getElementById('root')
);
